import React from "react";
import { Box, Center, Container, HoverCard, Grid } from "@mantine/core";

const Navbar = () => {
  return (
    <Grid>
      <Grid.Col span={4}>
        <Container fluid bg="var(--mantine-color-blue-light)">
          <Center>Nav Bar</Center>
        </Container>
      </Grid.Col>
    </Grid>
  );
};

export default Navbar;
